import React from 'react'
import Header from './Header';
import LeftNav from './LeftNav';


const MainPage = () => {
    let st = {
        margin: '1%'
    };
  return (
    <div style={st}>
    <Header/>
    <LeftNav/>
    </div>
  )
}

export default MainPage
